import React, { useState } from "react";
import {
  Typography,
  TextField,
  Button,
  Toolbar,
  Container,
} from "@mui/material";
import Navbar from "./Navbar";
import { useLocation } from "react-router-dom";

export default function MoviePage(props) {
  const { movie } = props;
  const location = useLocation()
  console.log("location:", location)

  return (
    <div>
      <Navbar />
      <Toolbar />
      <Container>
        <Typography variant="h5">Movie Page</Typography>
        <Typography variant="h5">{location.state.movie.id}</Typography>
      </Container>
    </div>
  );
}
